import React from 'react';
import Navbar from './component/Navbar'
import './App.css';

class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <Navbar />
      </div>
    )
  }

}

export default App;
